import React from 'react';
import {PopUpWindowContainer, HeaderButtonsContainer} from './pop-up-window.styles';

const PopUpWindow = (props) => {
    console.log(props, props.isCardPopUp, props.handlePopUpClose)

    return <PopUpWindowContainer{...props}><HeaderButtonsContainer><span onClick={props.handlePopUpClose}>&#120299;</span></HeaderButtonsContainer></PopUpWindowContainer>
}

export default PopUpWindow;
